$(document).ready(function(){$.fn.moveIt=function(){var t=$(window),n=[];$(this).each(function(){n.push(new o($(this)))}),window.onscroll=function(){var e=t.scrollTop();n.forEach(function(s){s.update(e)})}};var o=function(t){this.el=$(t),this.speed=parseInt(this.el.attr("data-scroll-speed"))};o.prototype.update=function(t){var n=t/this.speed;this.el.css("transform","translateY("+-n+"px)")},$(function(){$("[data-scroll-speed]").moveIt()})});
